$(".theme-justified").justifiedGallery(
    {
        selector:       '.gallery-element, > div:not(.spinner)',
        imgSelector:    '.gallery-element-thumbnail',
        rowHeight:      350,
        maxRowHeight:   500,
        captions:       true,
        margins:        5,
        lastRow:        'nojustify'
    }
);

$('.nav-tabs').find('a').on('shown.bs.tab', function () {
    $(".theme-justified").justifiedGallery(
        {
            selector:       '.gallery-element, > div:not(.spinner)',
            imgSelector:    '.gallery-element-thumbnail',
            rowHeight:      350,
            maxRowHeight:   500,
            captions:       true,
            margins:        5,
            lastRow:        'nojustify'
        }
    );
});
